<p><ref target="https://ug.wikipedia.org/wiki/قوغشار_تەڭرىقۇت">قوغشار تەڭرىقۇت</ref>نىڭ ئىنىسى ، مىلادىيە 56-يىلىدىن 57-يىلىغىچە تەختتە ئولتۇرغان . ئۇ ئاكىسىنىڭ ۋاپاتىدىن كېيىن ھۇن تەختىگە ۋارسلىق قىلغان ، لېكىن بىر يىلدىن كېيىنلا ۋاپات بولغان .</p></text></body></html>
